import React, { useState, useEffect } from "react";

const CountryImage = () => {
  const [endPoint, setEndPoint] = useState("");
  const [container, setContainer] = useState([]);
  const [finalPoint, setFinalPoint] = useState("");

  useEffect(() => {
    // fetchMe();
  }, [finalPoint]);

  const options = {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "3dc1a90a57msh1832834cdf55bdep1ed1b2jsnc624f5031a4f",
      "X-RapidAPI-Host": "hotel-price-aggregator.p.rapidapi.com",
    },
  };

  fetch(
    "https://hotel-price-https://api.giphy.com/v1/gifs/search?api_key=G2aSfGklbIhABGgUtipWmH5eVI6GyMCC&q=",
    endPoint
  )
    .then((response) => response.json())
    .then((response) => console.log(response))
    .then((data) => {
      setContainer(data);
      console.log(data);
    })
    .catch((err) => console.error(err));

  const handleChanges = (e) => {
    setEndPoint(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setFinalPoint(endPoint);
  };

  return (
    <div className="CountryImage">
      <form onSubmit={handleSubmit}>
        <input type="text" value={endPoint} onChange={handleChanges} />
        <button type="submit">submit</button>
      </form>

      {container.map((item) => {
        return (
          <div>
            {/* <h1> {item}</h1> */}
            <img src={endPoint} alt=""></img>
          </div>
        );
      })}
    </div>
  );
};
export default CountryImage;
